function triangle_unit_monomial_integral ( expon )

!*****************************************************************************80
!
!! triangle_unit_monomial_integral(): integral of a monomial over the unit triangle.
!
!  Discussion:
!
!    This routine integrates a monomial of the form
!
!      product ( 1 <= dim <= dim_num ) x(dim)^expon(dim)
!
!    where the exponents are nonnegative integers.  Note that
!    if the combination 0^0 is encountered, it should be treated
!    as 1.
!
!    Integral ( over unit triangle ) x^m y^n dx dy = m! * n! / ( m + n + 2 )!
!
!  Licensing:
!
!    This code is distributed under the MIT license. 
!
!  Modified:
!
!    04 July 2007
!
!  Author:
!
!    John Burkardt
!
!  Input:
!
!    integer EXPON(3), the exponents.
!
!  Output:
!
!    real ( kind = rk ) triangle_unit_monomial_integral: 
!    the value of the integral.
!
  implicit none

  integer, parameter :: rk = kind ( 1.0D+00 )

  integer expon(3)
  integer i
  integer k
  real ( kind = rk ) triangle_unit_monomial_integral
  real ( kind = rk ) value
!
!  The first computation ends with VALUE = 1.0;
!
  value = 1.0D+00

  k = 0

  do i = 1, expon(1)
    k = k + 1
!   value = value * real ( i, kind = rk ) / real ( k, kind = rk )
  end do

  do i = 1, expon(2)
    k = k + 1
    value = value * real ( i, kind = rk ) / real ( k, kind = rk )
  end do

  k = k + 1
  value = value / real ( k, kind = rk )

  k = k + 1
  value = value / real ( k, kind = rk )

  triangle_unit_monomial_integral = value

  return
end
